import React from 'react';
import logo from './logo.svg';
import './App.css';


const properties = { className: 'App-logo', src: logo, alt: 'Logo-no-jsx'  };

function App() {
  // return elements;
  return (
    <div className="App">
      <div className="message">
        <div className='message-header'>
          <img src={logo} alt='' className='message-header-image' />
        </div>
      </div>
    </div>
  );
}

export default App;
